func find_index(arr: List, target: Number): Number {
    let low = 0
    let high = arr.length - 1

    while (low <= high) {
        let mid = (low + high) / 2
        if (arr[mid] == target) {
            return mid
        } else if (arr[mid] < target) {
            low = mid + 1
        } else {
            high = mid - 1
        }
    }

    return -1
}

